建立连接
本小结详细介绍了SE3 AI 迷你机如何和云平台建立通信连接具体流程。部署人员在SE3 AI 迷你机提供的配置页面中，完成“设备ID”，“云平台URL”等信息的配置后，SE3 AI 迷你机就会向云平台发出一个http请求，获取到MQ连接需要的一些基本参数信息。“设备ID”是有云平台提供的，用于认证接入设备。


