用户管理
用户管理是指从云平台同步人员信息到SE3 AI 迷你机并完成入库的过程。因为用户信息中图片信息比较大，故在用户管理MQ消息推荐只传递的用户ID，图片信息由单独的web接口获取。SE3 AI 迷你机根据消息中的用户ID和path中指定的URL（获取用户）从云服务器中同步用户信息。详细流程如下：


